    }



    render() {

        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[this.state.index].id.videoId}
                    />
                </div>}
                <div className="Result_List">
                    <ul>
                    </ul>
                </div>

            </div>
        )
    }

}

export default Results
